import React from 'react'
import './Gallery.scss'
import Header from "../../Components/Header/Header";
import Footer from "../../Components/Footer/Footer";

export const Photo = () => {
    return (
        <div className="GalleryWrapper">
            <Header/>
            <div >
                <h1>Фотографии</h1>
            </div>
            <Footer/>
        </div>
    )
}

export default Photo;
